- input: "TEXT\x1CC00161786\x1CTEXT-00001\x1C\x1CF3XA\x1CThe Committee is in receipt
    of the Commission's request for additional information dated 6/4/2010 regarding
    Schedule A for Line 17 of the May Monthly Report for 2010.  The amended report
    clarifies all the receipts for Voter File Access to Candidates and Committee's
    that were provided at fair market value.  Please note that the employees that
    were disclosed on Schedule H4 supporting Line 21(a) as payroll spent less than
    25% of their time during the period working on any Federal Election Activity or
    activities in connection with a Federal Election therefore salary payments were
    allocable.  This also includes fringe benefits for those specific employees.  -
    \ Please note that all fundraising activity on this report was for the sole benefit
    of the Committee and was not attributable to any candidate for federal office.
    \ -  Per the agreement between DNC Counsel, Neil Reiff, and RAD Supervisor, Debbie
    Chacona, the Memo Schedule A's that itemize the committees share of the gross
    contributions received through the joint fundraising activities from the ASDC
    Dollars for Democrats, ASDC Partnership Program, CO Victory 2010 Fund and/or the
    DNC Victory Fund (Democratic National Committee) are provided on a quarterly basis.
    \   The transfer of the joint fundraising proceeds received during this reporting
    period from the DNC Victory Fund, ASDC Parnership Program, CO Victory 2010 Fund
    and/or  ASDC Dollars for Democrats programs, represents the committee's share
    of proceeds for contributions received during this or prior reporting periods.
    The memo entries for these contributions are included in this or a prior report
    of the committee.\n"
  record: fec.version.v6_4.TEXT
