    value: TEXT-00001
  - name: BACK REFERENCE TRAN ID NUMBER
    number: '4'
    value: ''
  - name: BACK REFERENCE SCHED / FORM NAME
    number: '5'
    value: F3XA
  - name: TEXT4000
    number: '6'
    value: 'The Committee is in receipt of the Commission''s request for additional
      information dated 6/4/2010 regarding Schedule A for Line 17 of the May Monthly
      Report for 2010.  The amended report clarifies all the receipts for Voter File
      Access to Candidates and Committee''s that were provided at fair market value.  Please
      note that the employees that were disclosed on Schedule H4 supporting Line 21(a)
      as payroll spent less than 25% of their time during the period working on any
      Federal Election Activity or activities in connection with a Federal Election
      therefore salary payments were allocable.  This also includes fringe benefits
      for those specific employees.  -  Please note that all fundraising activity
      on this report was for the sole benefit of the Committee and was not attributable
